import React from "react";

function Nav(props) {
    const {
        navItems = [],
        // currentNavItem,
        // setCurrentNavItem
    } = props;

    return (
        <nav>
            <ul className='flex-row'>
                {navItems.map((navItem) => (
                    <li className='mx-1' key={navItem.name}>
                        <span>
                            {navItem.name}
                            About Me
                        </span>
                    </li>
                ))}
            </ul>
        </nav>
    )
}

export default Nav;
